const apiKey = "somekey";
const apiUrl = `https://www.googleapis.com/webfonts/v1/webfonts?key=${apiKey}`;

// Use async/await for modern, clean syntax

function customFilter(list) {
    let largestNumber = 0;

    // Filter for text-only strings and find the largest number prefix
    const filteredList = list.filter(item => {
        // A regular expression to find numbers at the beginning of a string
        const match = item.match(/^(\d+)/);

        if (match) {
            // If a number prefix is found, convert it to an integer
            const number = parseInt(match[1]);

            // Update largestNumber if the current number is bigger
            if (number > largestNumber) {
                largestNumber = number;
            }
            return false; // Exclude number-prefixed strings from the initial filter
        }

        // Include strings that don't have a number prefix
        return true;
    });

    // Find the string with the largest number prefix
    const largestNumberString = list.find(item => {
        const match = item.match(/^(\d+)/);
        // Check if the item starts with the largest number found
        return match && parseInt(match[1]) === largestNumber;
    });

    // Combine the text-only strings and the string with the largest number
    if (largestNumberString) {
        filteredList.unshift(largestNumberString);
    }

    return filteredList;
}

async function listTtfFonts() {
    try {
        const response = await fetch(apiUrl);

        // Check if the request was successful
        if (!response.ok) {
            throw new Error(`HTTP error! status: ${response.status}`);
        }

        // Parse the JSON response
        const data = await response.json();

        // Iterate through each font family and extract the TTF files
        console.log("Available TTF font files:");
        data.items.forEach(font => {
            // The API's `files` object contains URLs for different font variants.
            // For standard TTF files, check the keys like "regular", "italic", etc.
            if (font.files) {

                var keys = customFilter(Object.keys(font.files));
                for (const variant of keys) {
                    const fileUrl = font.files[variant];
                    // Filter specifically for URLs ending in .ttf
                    if (fileUrl.endsWith(".ttf")) {
                        //console.log(`${font.family} (${variant}): ${fileUrl}`);
                        AVAILABLE_FONTS.push({ value: fileUrl, label: font.family + " " + variant });
                    }
                }
            }
        });

        console.log(JSON.stringify(AVAILABLE_FONTS));

    } catch (error) {
        console.error("Failed to fetch fonts:", error);
    }
}
